description:
Verenigde Staten
Horror
97 minuten

goed

met Steffany Huckaby, Annie Burgstede en Kristin Novak

In het ziekenhuis van Waverly Hills in Louisville, Kentucky heerst een virus. Door dit virus sterven duizenden mensen en ze 
worden via ondergrondse tunnels naar het sanatorium gebracht. Vijf meisjes van de universiteit moeten tijdens een ontgroening 
vijf uren doorbrengen in het sanatorium met vijf verdiepingen en de ondergrondse tunnels tussen de geesten die er ronddwalen.
